comment.body:
@manast It's not a technical limitation in terms of hosting, technically speaking, we could change it. However, other services write a lot of data into Redis and we want to be safe and evict old keys (LRU). So changing this setting would not just impact the BullMQ queue, but all other services, too. We barely ever run into this, however, if we do, a noeviction policy could greatly impact our performance, thus, we can't just flip the switch because of BullMQ processing.

The only solution on our side would be setting up a separate Redis instance for the queue, which I'd like to avoid, at least for the upgrade to V2.

I do understand the possible side-effect and I think throwing an error is a reasonable default behavior - it would just be great to ignore it or have it as a warning only. That would allow us to upgrade to BullMQ V2 and eventually set up a separate Redis for the queue in the future. Otherwise, we'll have to stay on V1 for now.

issue.body:
When using a generic type parameter in the inner function, it seems to be omitted.

```ts
const getFieldCB = new CircuitBreaker(getField);

async function getField<T>({ hash, key }: { hash: string; key: string }): Promise<null | T> {
  const entry = await redisInstance().hgetBuffer(hash, key);

  return decompress<T>(entry);
}
```

```ts
getFieldCB.fire({hash: 'a', key: 'b'})
```

Expected return value: `Promise<null | T>` (as defined on the function)
Actual return value: `Promise<unknown>`

